import React, { useState } from "react";
import { Paper, Divider, } from "@material-ui/core";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import mockHotel from "../../MapBundle/Stories/mockHotels.json"
import themes from "../../Theme/themes";
import { BrandType } from "../../types/brand";
import MapNoResult from "../MapNoResult";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
}));

type MapNoResultStoryProps = {
    mode: string,
    brand: BrandType
}

const initDefaultData = () => {
    const middleLocation = mockHotel.hoteis[Math.floor(mockHotel.hoteis.length / 2)];
    return {
        title: "2",
        coordinates: {
            latitude: middleLocation.location.coordinates.latitude,
            longitude: middleLocation.location.coordinates.longitude,
        },
        zoom: 9
    }
}

const MapNoResultStory = ({
    mode, brand
}: MapNoResultStoryProps) => {
    const classes = useStyles(themes[brand]);
    const [defaultData] = useState(initDefaultData);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="MapNoResult">
                <Typography variant="h3">MapNoResult</Typography>
                <br />
                <Divider />
                <br />
                <MapNoResult
                    defaultData={defaultData}
                    openInfo={false}
                    googleMapURL="https://www.google.com.br/maps/api/js?key=AIzaSyB_-QHk0PCeDlXgsi3bAuklXA--pfZQsdI&v=3.exp&libraries=geometry,drawing,places"
                    loadingElement={<div style={{ height: "100%" }} />}
                    containerElement={<div style={{ height: "400px" }} />}
                    mapElement={<div style={{ height: "100%" }} />}
                    zoom={10}
                />
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
    }
}

storiesOf("Components/Mapas/MapNoResult", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <MapNoResultStory {...args}/>, argsControls);
